var fileJSON=[{"path":"c:/Users/Elija/Documents/LAP_hls_benchmarks/IntelHLS/Cleaned/covariance/covariance.cpp", "name":"covariance.cpp", "has_active_debug_locs":false, "absName":"c:/Users/Elija/Documents/LAP_hls_benchmarks/IntelHLS/Cleaned/covariance/covariance.cpp", "content":"#include <HLS/hls.h>\012#include <stdlib.h>\012#include <stdio.h>\012#include <math.h>\012\012#define N 32\012\012using namespace ihc;\012\012typedef ihc::mm_host<int, ihc::dwidth<32>,\012                          ihc::awidth<32>,\012                          ihc::latency<1> > mem_data;\012typedef ihc::mm_host<int, ihc::dwidth<32>,\012                          ihc::awidth<32>,\012                          ihc::latency<1> > mem_cov;\012\012component void covariance(mem_data &data, mem_cov &cov)\012{\012  for (int j = 0; j < N; j++) {\012      int m =0;// 0.0f;\012      for (int i = 0; i < N; i++)\012      {\012        m += data[i * N + j];\012      }\012      m *=2;///= 0.73f;\012        \012      for (int i = 0; i < N; i++)\012        data[i * N + j] -= m;\012    }\012\012    for (int i = 0; i < N; i++) {\012      for (int j = i; j < N; j++) {\012        int c = 0;//0.0f;\012        for (int k = 0; k < N; k++)\012        {\012            c += data[k * N + i] * data[k * N + j];\012        }\012        c *=2;// /= -0.27f;\012        cov[i * N + j] = c;\012      }\012    }\012}\012\012void covariance_ref(int data[N][N], int cov[N][N])\012{\012  for (int j = 0; j < N; j++) {\012      int m =0;// 0.0f;\012      for (int i = 0; i < N; i++)\012      {\012        m += data[i][j];\012      }\012      m *=2;///= 0.73f;\012        \012      for (int i = 0; i < N; i++)\012        data[i][j] -= m;\012    }\012\012    for (int i = 0; i < N; i++) {\012      for (int j = i; j < N; j++) {\012        int c = 0;//0.0f;\012        for (int k = 0; k < N; k++)\012        {\012            c += data[k][i] * data[k][j];\012        }\012        c *=2;// /= -0.27f;\012        cov[i][j] = c;\012      }\012    }\012}\012\012int main(void){\012	int data[N * N];\012  int cov[N * N];\012  int data_ref[N][N];\012  int cov_ref[N][N];\012\012  srand(9);\012\012  for (int i = 0; i < N; i++) {\012    for (int j = 0; j < N; j++) {\012      data_ref[i][j] = rand();\012      data[i * N + j] = data_ref[i][j];\012      cov_ref[i][j] = rand();\012      cov[i * N + j] = cov_ref[i][j];\012    }\012  }\012\012  covariance_ref(data_ref, cov_ref);\012\012  mem_data mem_host_data(data, N * N * sizeof(int), false);\012	mem_cov mem_host_cov(cov, N * N * sizeof(int), false);\012\012  ihc_hls_enqueue_noret(&covariance, mem_host_data, mem_host_cov);\012	ihc_hls_component_run_all(&covariance);\012\012  for(int i = 0; i < N; i++)\012  {\012    for(int j = 0; j < N; j++)\012    {\012        if(cov[i * N + j] != cov_ref[i][j])\012        {\012            printf(\"FAILED\\n\");\012            return 0;\012        }\012    }\012  }\012  \012  printf(\"PASSED\\n\");\012\012  return 0;\012}\012\012"}];
